#include <stdio.h>

int main(void)
{

	int i,j,k;
	double a,t,c,g;
	char ch[40000];

	a=0;
	t=0;
	g=0;
	c=0;
  char gene[] = "";

	for(i=0;gene[i] != '\0';i++){

		if( gene[i] == 'A' ){
			a++;
		}else if( gene[i] == 'T' ){
			t++;
		}else if( gene[i] == 'G' ){
			g++;
		}else if( gene[i] == 'C' ){
			c++;
		}

	}

	printf(" a/i=%f%% t/i=%f%% c/i=%f%% g/i=%f%%\n",(a/i)*100,(t/i)*100,(c/i)*100,(g/i)*100);

	k=0;
	for(i=0;gene[i]!='\0';i++){
	  if(gene[i] == 'A' && gene[i+1] == 'G' && gene[i+2] == 'C' && gene[i+3] == 'T' && gene[i+4] == 'T' && gene[i+5] == 'A'){
	    k++;
	  }
	}
	printf("count %d\n",k);


	for(i=0;gene[i]!='\0';i++){
	  if(gene[i] == 'G' && gene[i+1] == 'T' && gene[i+2] == 'A' && gene[i+3] == 'C' && gene[i+4] == 'A'){

			gene[i]   = 'A';
			gene[i+1] = 'A';
			gene[i+2] = 'A';
			gene[i+3] = 'M';
			gene[i+4] = 'M';
	  }
	}

	for(i=0;gene[i] != '\0';i++){
		if(gene[i] != 'M'){
			printf("%c",gene[i]);
		}
	}


	j=0;
	for(i=0;gene[i] != '\0';i++){
		if(gene[i] != 'M'){
			ch[j] = gene[i];
			j++;
		}
	}

	ch[j] = '\0';

	printf("%s",ch);


	return 0;

}
